import React, { useState } from 'react';
import { PageArea } from './styled';
import { PageContainer, PageTitle } from '../../components/MainComponents'

function Page(){

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [stayloggued, setStaylogged] = useState('');
    const [disable, setDisable] = useState(false);

    const handleSubmit = (e) => {
        e.preventDefault();
    }

    return(
        <PageContainer>
            <PageTitle>Login</PageTitle>
            <PageArea>
                <form onSubmit={handleSubmit}>
                    <label className="area">
                        <div className="area-title">Email</div>
                        <div className="area-input">
                            <input type="email" disabled={disable} />
                        </div>
                    </label>
                    <label className="area">
                        <div className="area-title">Senha</div>
                        <div className="area-input">
                            <input type="password" disabled={disable} />
                        </div>
                    </label>
                    <label className="area">
                        <div className="area-title">Permanecer Logado?</div>
                        <div className="area-input">
                            <input type="checkbox" disabled={disable} />
                        </div>
                    </label>
                    <label className="area">
                        <div className="area-title"></div>
                        <div className="area-input">
                            <button disabled={disable}>Logar</button>
                        </div>
                    </label>
                </form>
            </PageArea>
        </PageContainer>
    )
}

export default Page;
